GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_SpotlightUpdate]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_SpotlightUpdate] 
	@UserId uniqueidentifier,
    @Awards nvarchar(256),
    @Achievements nvarchar(256),
    @CurentGPA nvarchar(256),
    @OraganizationId int,
    @Involvments nvarchar(256),
    @FraternityId int,
    @SoroityId int,
    @GreekHonorSocitiesId int,
    @GreakOrganizationId int,
    @IsDeleted bit = NULL,
    @UpdatedBy uniqueidentifier,
    @UpdatedDate datetime output
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  
	
	SET @UpdatedDate = GETUTCDATE()
	
	BEGIN TRAN

UPDATE [dbo].[Spotlight]
   SET [Awards] = @Awards
      ,[Achievements] = @Achievements
      ,[CurentGPA] = @CurentGPA
      ,[OraganizationId] = @OraganizationId
      ,[Involvments] = @Involvments
      ,[FraternityId] = @FraternityId
      ,[SoroityId] = @SoroityId
      ,[GreekHonorSocitiesId] = @GreekHonorSocitiesId
      ,[GreakOrganizationId] = @GreakOrganizationId
      ,[IsDeleted] = @IsDeleted
      ,[UpdatedBy] = @UpdatedBy
      ,[UpdatedDate] = @UpdatedDate
 WHERE [UserId] = @UserId

COMMIT

' 
END
