/****** Object:  StoredProcedure [dbo].[usp_Spotlight_IsSpotlightExist]    Script Date: 03/26/2015 02:24:14 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER OFF
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_Spotlight_IsSpotlightExist]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROCEDURE [dbo].[usp_Spotlight_IsSpotlightExist]
     @UserId uniqueidentifier,
	@IsExist bit output
AS
BEGIN
    IF exists (select null from Spotlight where UserId=@UserId)
	BEGIN
        SET @IsExist = 1
	END
	ELSE
	BEGIN
		SET @IsExist = 0
	END
    
END

' 
END
