BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_StudentUpdate] 

     (@StudentId uniqueidentifier,
           @UserId uniqueidentifier,
           @SchoolId uniqueidentifier,
           @Year int,
           @StartYear int,
           @StartMonth int,
           @Status nvarchar(50),
           @MajorId int,
           @PreviousSchoolInfo nvarchar(50),
           @PreviousSchool nvarchar(256),
           @IsDeleted bit,
           @UpdatedBy uniqueidentifier,
			@UpdatedDate datetime output)
    
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  
	
	BEGIN TRAN

	SET @UpdatedDate = GETUTCDATE()

	UPDATE [dbo].[Student]
	SET		[StudentId] = @StudentId, 
			[UserId] = @UserId, 
			[SchoolId] = @SchoolId, 
			[Year] = @Year,
			[StartYear] = @StartYear,
            [StartMonth] = @StartMonth,
			[Status] = @Status,
