/****** Object:  StoredProcedure [dbo].[usp_UserSelectAll]    Script Date: 03/26/2015 02:24:45 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_UserSelectAll]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_UserSelectAll] 
    @UserId uniqueidentifier
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  

	BEGIN TRAN

	SELECT 
		U.[UserId], 
		U.[IsFBUser], 
		U.[AspnetUserId],
        U.[IsPartialUser],
		U.[FBAccessToken], 
		U.[FBUrl], 
		U.[FBTokenTimeStamp], 
		U.[FBProfilePictureURL], 
		U.[FirstName],
		U.[MiddleName],
		U.[LastName],
		U.[StreetAddress], 
		U.[City], 
		U.[StateId],
		U.[Zip], 
		U.[DateOfBirth], 
		U.[BestContactNumber], 
		U.[DriversLicenseNumber], 
		U.[Status], 
		U.[PersonalEmail], 
		U.[RatingValue], 
		U.[FBid],
		U.[Gender],
		U.[HouseId],
		U.RoleId,
		U.ReferralCode,
		CASE
			WHEN S.StudentId IS NOT NULL THEN ''Student''
			WHEN L.LandlordId IS NOT NULL THEN ''Landlord''
		end as UserType
	FROM   [dbo].[User] U 
		LEFT OUTER JOIN [dbo].[Student] S ON U.UserId = S.UserId
		LEFT OUTER JOIN [dbo].[Landlord] L ON L.UserId = U.UserId

	WHERE  (isnull(U.IsDeleted,0) <> 0 ) 

	COMMIT

' 
END
