/****** Object:  StoredProcedure [dbo].[usp_UserSelectUsernameByFbId]    Script Date: 03/26/2015 02:24:50 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_UserSelectUsernameByFbId]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_UserSelectUsernameByFbId] 
    @FBId nvarchar(50),
	@Username nvarchar(256) output
AS 
	BEGIN
		IF exists (select null from [User] where FBid=@FbId)
		BEGIN
			SELECT @Username = au.UserName
			FROM   [dbo].[User] U inner join aspnet_Users au on au.UserId = u.UserId
			WHERE  u.FBid = @FBId and isnull(U.IsFBUser,0) = 1
		END
		ELSE
		BEGIN
			SET @Username = ''''
		END
	END

	BEGIN TRAN



	COMMIT

' 
END
GO
/****** Object:  StoredProcedure [dbo].[usp_Student_Search ]    Script Date: 03/26/2015 02:24:23 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_Student_Search ]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_Student_Search ]
    @StudentId uniqueidentifier,
	@SchoolId uniqueidentifier
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  

	SELECT 
		S.[StudentId], 
		S.[UserId], 
		S.[SchoolId], 
		S.[Year],
		sc.[Name] as SchoolName,
		sc.[StreetAddress] as SchoolStreetAddress,
		sc.[ContactNumber] as SchoolContactNumber,
		u.City,
		u.BestContactNumber,
		u.DriversLicenseNumber,
		u.PersonalEmail,
		u.RatingValue as StudentRatingValue,

		S.[IsDeleted], 
		S.[CreatedBy], 
		S.[CreatedDate], 
		S.[UpdatedBy], 
		S.[UpdatedDate]

	FROM   [dbo].[Student] s inner join [User] u on u.UserId = s.UserId
	inner JOIN School sc on sc.[SchoolId] = s.SchoolId
	inner join aspnet_Users au on au.UserId = s.UserId

	WHERE  (S.[StudentId] = @StudentId OR @StudentId IS NULL) AND
			(s.SchoolId = @SchoolId or @SchoolId IS NULL)

' 
END
GO
/****** Object:  StoredProcedure [dbo].[aspnet_UnRegisterSchemaVersion]    Script Date: 03/26/2015 02:22:52 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER OFF
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[aspnet_UnRegisterSchemaVersion]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROCEDURE [dbo].[aspnet_UnRegisterSchemaVersion]
    @Feature                   nvarchar(128),
    @CompatibleSchemaVersion   nvarchar(128)
AS
BEGIN
    DELETE FROM dbo.aspnet_SchemaVersions
        WHERE   Feature = LOWER(@Feature) AND @CompatibleSchemaVersion = CompatibleSchemaVersion
END

' 
END
