IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[usp_CommentUpdate]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROC [dbo].[usp_CommentUpdate] 
    @CommentId int,
    @ContextTypeId int,
    @ContextId uniqueidentifier,
    @CommentText nvarchar(MAX) = NULL,
    @RatingValue decimal(5, 2),
    @IsDeleted bit = NULL,
    @UpdatedBy uniqueidentifier,
    @UpdatedDate datetime output
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  
	
	set @UpdatedDate = GETUTCDATE()

	BEGIN TRAN

	UPDATE [dbo].[Comment]
	SET    [ContextTypeId] = @ContextTypeId, [ContextId] = @ContextId, [CommentText] = @CommentText, [RatingValue] = @RatingValue, [IsDeleted] = @IsDeleted, [UpdatedBy] = @UpdatedBy, [UpdatedDate] = @UpdatedDate
	WHERE  [CommentId] = @CommentId
	
	COMMIT

' 
END
